import styles from '../styles/scss/dashboard-menu.module.scss';
import Profile from '../components/Profile';
import DashboardMenuItem from '../components/DashboardMenuItem';

const DashboardMenu = () => {
	return (
		<div className={styles.dashboardMenuContainer}>
			<div className={styles.divProfile}>
				<Profile />
			</div>
			<div className={styles.dashboardMenuItems}>
				<DashboardMenuItem menuTitle={'Home'} menuIconImgRef={'/images/menu-icons/home.png'} />
				<DashboardMenuItem menuTitle={'Worflows'} menuIconImgRef={'/images/menu-icons/workflow_image.png'} />
				<DashboardMenuItem menuTitle={'Shared with me'} menuIconImgRef={'/images/menu-icons/shared.png'} />
				<DashboardMenuItem menuTitle={'Starred'} menuIconImgRef={'/images/menu-icons/starred.png'} />
				<DashboardMenuItem menuTitle={'Statistics'} menuIconImgRef={'/images/menu-icons/statistics.jpg'} />
				<DashboardMenuItem menuTitle={'Profile'} menuIconImgRef={'/images/menu-icons/profile.png'} />
			</div>
			<div className={styles.summaryStats}>
				<p>
					<span className={styles.workflowTitle}>Workflows</span>
					<br />
					<span className={styles.numWorkflows}>5</span>
				</p>
				<img src="./images/workflow_images.png" alt="Workflows" />
			</div>
		</div>
	);
};

export default DashboardMenu;
